import React, { memo } from "react";

import { HeaderRankingWrapper } from "./style";
export default memo(function LJThemeHeaderRanking() {
  return (
    <HeaderRankingWrapper>
      <div className="main">
        <div className="left">
          <div className="title"></div>
          <div className="songNumber"></div>
        </div>
        <div className="right">
          <span className="default">播放</span>
          <span className="playNumber">播放</span>
          <span className="default">次</span>
        </div>
      </div>
      <div className="divide"></div>
    </HeaderRankingWrapper>
  );
});
